from tkinter import *


def splash_screen():
    global splashframe
    splashframe = Tk()
    backDrop = PhotoImage(data='')
    splashframe.config(bg="#2B2B2B")
    ws = splashframe.winfo_screenwidth()
    hs = splashframe.winfo_screenheight()
    w = 400
    h = 100
    # calculate position x, y
    x = (ws / 2) - (w / 2)
    y = (hs / 2) - (h / 2)
    splashframe.geometry('%dx%d+%d+%d' % (w, h, x, y))

    splashframe.overrideredirect(True)
    splashframe.wm_attributes("-topmost", 1)
    m = Label(splashframe, image=backDrop)
    m.image = backDrop
    m.pack(side=TOP, expand=YES)
    m.config(bg="#2B2B2B", justify=CENTER, font=("calibri", 29))
    splashframe.update()

def destroy_splash():
    splashframe.destroy()